import { Component, OnInit } from '@angular/core';
import { ActivatedRoute } from '@angular/router';
import { Observable } from 'rxjs';
import { shoeService } from 'src/app/services/shoe.service';
import { shoe } from 'src/app/shared/models/shoe';

@Component({
  selector: 'app-home',
  templateUrl: './home.component.html',
  styleUrls: ['./home.component.css']
})
export class HomeComponent implements OnInit {

  shoes: shoe[] = [];
  constructor(private shoeService: shoeService, activatedRoute: ActivatedRoute) {
    let shoesObservalbe:Observable<shoe[]>;
    activatedRoute.params.subscribe((params) => {
      if (params.searchTerm)
        shoesObservalbe = this.shoeService.getAllshoesBySearchTerm(params.searchTerm);
      else if (params.tag)
        shoesObservalbe = this.shoeService.getAllshoesByTag(params.tag);
      else
        shoesObservalbe = shoeService.getAll();

        shoesObservalbe.subscribe((servershoes) => {
          this.shoes = servershoes;
        })
    })
  }

  ngOnInit(): void {
  }

}
<app-search></app-search>
<app-tags></app-tags>
<app-not-found
[visible]="!shoes || !shoes.length"
resetLinkText="Reset Search">
</app-not-found>
<ul>
  <li *ngFor="let shoe of shoes">
    <a routerLink="/shoe/{{shoe.id}}">
      <img [src]="shoe.imageUrl" [alt]="shoe.name" />
      <div class="content">
        <div class="name">
          {{shoe.name}}
        </div>
        <span class="favorite {{shoe.favorite?'':'not'}}">
          ❤
        </span>
        <div class="stars">
          <star-rating [stars]="shoe.stars" />
        </div>
        <div class="product-item-footer">
          <div class="origins">
            <span *ngFor="let origin of shoe.origins">
              {{origin}}
            </span>
          </div>

          <div class="cook-time">
            <span>🕒</span>
            {{shoe.delieryTime}}
          </div>
        </div>

        <div class="price">
          <span>
            {{shoe.price | currency: 'INR'}}
          </span>
        </div>
      </div>
    </a>
  </li>
</ul>
